class Main extends Component {
    state = { 
        Persons: [
            {name:'john', age:24},
            {name:'Tonoy', age:25}
        ]
     }
    render() { 
        return ( 
           <div>
              <h3>{this.state.Persons.name}</h3>
           </div> 
         );
    }
}

export default Main;
